<h4>Version 1.9.0</h4>

<p>Starting from Bazar 1.9.0 version, according to Theme Forest policies,
plugins <strong>"Revolution Slider" and "uSquare"will be managed as independent plugins</strong>  and they won't be automatically integrated
into the theme at the activation of the theme. Consequentely those who have already
installed a previous version of Bazar and are going to update to the 1.9.0 version
will have to install and activate the two plugins to use them.</p>
<p>You will simply need to click the button "Begin Installing Plugin" into the message
that is going to appear into the dashboard of your website and then install both
plugins into the table that will come out on your screen.</p>
<p>Finally, you can activate the plugins from Wordpress page. Following this instructions,
the plugin will work again as in the previous version of the theme and you will
be able to completely use all their features.</p>

